        cy.step('Assert the modal is visible');
        modal.getNode().should('be.visible');
        cy.step('Press confirmation button');
        modal.confirm();
        cy.step('Verify canvas');
        canvas.within(function () {
          cy.get("".concat(symbolTag, " #singletext")).should('have.text', 'This is default single line');
        });
        cy.step('Assert element is no longer bound');
        binding.isBound(false);
      }

